import React, { useState } from 'react'
import Socket from '../../Socket'


export const Camara = () => {
    const [data, setData] = useState(null)
    Socket.on('stream', (image) => {

        setData(image)
    })
    return (
        (!data === "") ? < img src={data} alt="" /> : <div>No hay servidor socket</div>

    )
}
